  public static SystemFontPost ReadPostTable(
    SystemFontOpenTypeFontSourceBase fontSource,
    SystemFontOpenTypeFontReader reader)
  {
    float num = reader.ReadFixed();
    SystemFontPost systemFontPost;
    if ((double) num == 1.0)
      systemFontPost = (SystemFontPost) new SystemFontPostFormat1(fontSource);
    else if ((double) num == 2.0)
    {
      systemFontPost = (SystemFontPost) new SystemFontPostFormat2(fontSource);
    }
    else
    {
      if ((double) num != 3.0)
        return (SystemFontPost) null;
      systemFontPost = (SystemFontPost) new SystemFontPostFormat3(fontSource);
    }
    systemFontPost.Read(reader);
    return systemFontPost;
  }

  static SystemFontPost() => SystemFontPost.Initialize();

  public SystemFontPost(SystemFontOpenTypeFontSourceBase fontSource)
    : base(fontSource)
  {
  }

  public abstract ushort GetGlyphId(string name);

  public override void Read(SystemFontOpenTypeFontReader reader)
  {
    double num1 = (double) reader.ReadFixed();
    int num2 = (int) reader.ReadShort();
    int num3 = (int) reader.ReadShort();
    int num4 = (int) reader.ReadULong();
    int num5 = (int) reader.ReadULong();
    int num6 = (int) reader.ReadULong();
    int num7 = (int) reader.ReadULong();
    int num8 = (int) reader.ReadULong();
  }
